local url = "http://"..self.isaacAdapterIP..":"..tostring(math.floor(pixc.getRoot().pixcGetWebserverPort())).."/static/ui_builder/ui_builder.html?device="..self().."&blocks=false&localMain=Pixera"
pixc.log(url)

return url;

if self.Data.VariableData == nil then
	return
end

local variables = self.Data.VariableData.Variables
local templateNumber = [[
	{
		"name": "##Name##",
		"subPath" : "##Path##",
		"kind": "fn",
		"attKind": "standard",
		"params": [
			{
				"name": "value",
				"type": "int"
			}
		],
		"result": {
		},
		"body": "-- attKind:standard \r\n-- slotStyle:leftIn;rightNone;triggerHidden \r\n if value == nil then pixcCommon.execAttribute(false, self.Variables.VAR_int__##Name##, self.Variables.VAR_int__##Name##, true); return; end \r\n self.Helper.VariableHelper.setVariableSubsystem('##Name##',value) ; self.Variables.VAR_int__##Name## = pixcCommon.execAttribute(false, self.Variables.VAR_int__##Name##, value, true);"
	}
]]

local templateString = [[
	{
		"name": "##Name##",
		"subPath" : "##Path##",
		"kind": "fn",
		"attKind": "standard",
		"params": [
			{
				"name": "value",
				"type": "string"
			}
		],
		"result": {
		},
		"body": "-- attKind:standard \r\n-- slotStyle:leftIn;rightNone;triggerHidden \r\n if value == nil then pixcCommon.execAttribute(false, self.Variables.VAR_int__##Name##, self.Variables.VAR_int__##Name##, true); return; end \r\n self.Helper.VariableHelper.setVariableSubsystem('##Name##',value) ; self.Variables.VAR_int__##Name## = pixcCommon.execAttribute(false, self.Variables.VAR_int__##Name##, value, true);"
	}
]]
local res = '[';
local nrVariables = 0;

for n, v in pairs(variables or {}) do
	nrVariables = nrVariables+1
end
local count = 1
if nrVariables == 0 then
	local tmod = templateNumber;
	local c;
	tmod, c = string.gsub(tmod,"##Name##", "")
	tmod, c = string.gsub(tmod,"##Path##", "Variables")
	res = res..tmod;
else
	for n, v in pairs(variables) do
		local tmod = templateNumber;
		if v.type == "string" then
			tmod = templateString
		end

		local c;

		tmod, c = string.gsub(tmod,"##Name##", n)
		tmod, c = string.gsub(tmod,"##Path##", "Variables")
		res = res..tmod;
		if nrVariables ~= count then
			res = res..','
		end
		count = count+1
	end
end

res = res..']'
--pixc.log(res)
return res;

--
self.Helper.requireJson()
local events = self.events
local elements = {}
for _, event in ipairs(events or {}) do
	local element = {
		type = 'UbControlLayout',
		dims = {x = 0, y = 0, width = 750, height = 40},
		data = {
			layout = 'stack_horizontal',
			controls = {
				{
					type = 'UbControlButton',
					label = event.displayName or 'null',
					dims = {x = 0, y = 0, width = 150, height = 30}
				},
				{
					type = 'UbControlButton',
					label = event.description or '',
					dims = {x = 0, y = 0, width = 150, height = 30}
				},
				{
					type = 'UbControlButton',
					label = event.command or 'null',
					dims = {x = 0, y = 0, width = 350, height = 30}
				},
				{
					type = 'UbControlButton',
					label = 'Delete',
					dims = {x = 0, y = 0, width = 50, height = 30},
					invoc = {
						{kind = "interface", name = self()..""},
						{kind = "ns", name = "Events"},
						{
							kind = "func", 
							name = "removeEventById",
							params = {
								{ type = "string", name = "id", value = event._id or 'null'}
							}
						}
					}
				}
			}
		}
	}

	table.insert(elements, element)
end
self.UI.linkedActionOfLayout({
	kind = "setControls",
	descrip = elements
})

--
self.Helper.requireJson()
local variables = {}
local elements = {}
--pixc.log("Variables",pixcCommon.toJson(variables))
if self.Data.VariableData ~= nil and self.Data.VariableData.Variables then
	variables = self.Data.VariableData.Variables
end
for n, v in pairs(variables or {}) do
	local element = {
		type = 'UbControlLayout',
		dims = {x = 0, y = 0, width = 750, height = 40},
		data = {
			layout = 'stack_horizontal',
			controls = {
				{
					type = 'UbControlButton',
					label = n or 'null',
					dims = {x = 0, y = 0, width = 150, height = 30}
				},
				{
					type = 'UbControlButton',
					label = v.type or '',
					dims = {x = 0, y = 0, width = 150, height = 30}
				},
				{
					type = 'UbControlButton',
					label = 'Delete',
					dims = {x = 0, y = 0, width = 50, height = 30},
					invoc = {
						{kind = "interface", name = self()..""},
						{kind = "ns", name = "Data"},
						{
							kind = "func", 
							name = "removeVariable",
							params = {
								{ type = "string", name = "name", value = n or 'null'}
							}
						}
					}
				}
			}
		}
	}

	table.insert(elements, element)
end
local a = {
	kind = "setControls",
	descrip = elements
}
self.UI.linkedActionOfVariableLayout(a)

